var liney = null
function handle3 (vals){ 
    if(linex) {
        append_in_ui(
            "s3_id", 
            svg_line({x1: linex, y1: liney, x2: vals.offsetX, y2: vals.offsetY}))
    }
   else {
       append_in_ui(
           "s3_id", 
           svg_circle({cx: vals.offsetX, cy: vals.offsetY, 
                       r: 5, color: "blue"})) 
   }
   linex = vals.offsetX
   liney = vals.offsetY
}

